import React,{setState} from "react"
import ApiLogin from "../Api/apiLogin";

const ReqLogin = (props) => {

    const[data,setData]=setState({
         username:'imelda',
         password:'password'
    })

   const onSignIn=async () =>{

       

        let result = await ApiLogin.login(data.username, data.password)

        if (result) {
            alert(JSON.stringify(result))
            // localStorage.setItem(config.LS.USERDATA, JSON.stringify(result.message.userdata))
            // localStorage.setItem(config.LS.TOKEN, result.message.token)
            // this.props.history.push('/home')
        } else {
            alert(JSON.stringify(result))
        }

       
    }
  return (
    <main id="main" class="main">

        <div class="pagetitle">
          <h1>Dashboard</h1>
          <nav>
            <ol class="breadcrumb">
              <li class="breadcrumb-item"><a href="index.html">Home</a></li>
              <li class="breadcrumb-item active">Dashboard</li>
            </ol>
          </nav>
        </div>

        <section class="section dashboard">
          <div class="row">


            <div class="col-lg-12">
              <div class="row">

              <button  onClick={onSignIn}>Sign in</button>



              </div>
            </div>



          </div>

        </section>

      </main>
    // <div>
    //   <button  onClick={onSignIn}>Sign in</button>
    // </div>
  )
};

export default ReqLogin;
